INSERT INTO `t_intro` VALUES ('1', '<p><em><strong><span style=\"font-size: 24px;\">金融互助，谁将一统天下？香港的梦幻币（MHB）合法的走向世界！<br/>2016年互联网起航的一年，抱团取暖的一年，是以帮助别人实现梦想从而达到实现自我梦想为主题的理念，响应国家号召为推广全民互联网＋时代服务的中心思想为主导，力争达到全民参与！<br/>第一波财富盛宴来袭，颠覆你的思维，撞击你的灵魂！你相信也好，抨击也好，它都在顽强的生长！趋势就是这么强势来袭！悄然成就着善于把握机会的人！<br/>如今各种名目互助盘令人眼花缭乱无所适从。在此敬告广大投资人：国内95%的互助盘皆为临时搭架，不经久战！MHB却一路高歌走来！<br/>MHB的四个唯一<br/>1：唯一一家落地的平台，根基性发展。（在香港设定成功启动的，国际化~人性化~综合化~多元化的运营服务中心）<br/>2：唯一一家高利息存活并仍稳健发展的平台。<br/>3：唯一一家国际多元化发展视野平台（虚拟货币，虚拟商城，大数据的建设，大金融的开发，大资源的整合）<br/>4：唯一一家多个系统开发与运营的平台（风险控制大大提高~运行压力大大缓解~建立数据的周期大大缩短）<br/>这四个唯一MHB必胜！跟随MHB的家人们必赢。<br/></span></strong></em></p>');
